import React from 'react';
import {Routes,Route} from "react-router-dom";
import {ROUTING} from "./contsRoute";
import Container from "../componets/layout/container/container";

const AppRoute = () => {
    return (
        <Routes>
            {ROUTING.map(link=>(
                <Route key={link.path} path={link.path} element={
                    <Container>
                        {link.component}
                    </Container>
                }/>
            ))}
        </Routes>
    );
};

export default AppRoute;
